import React from "react";
import "./style.css";
const Home = () => {
    return (
        <div className="homeDiv">
           <h1>Hello This is home page</h1> 
           <p className="infoText">You can find information about me here, as well
                as information on how to contact me and links 
                to my projects.
            </p>
        </div>
    )
}
export default Home;
